css:
@keyframes bracket-animation {
  from {
    border-color: #ffffff;
  }
  40% {
    border-color: rgba(227, 230, 232, 0.615);
  }
  to {
    border-color: rgba(227, 230, 232, 0.45);
  }
}
atom-text-editor.editor .bracket-matcher .region {
  animation: bracket-animation 0.85s;
  border: 1px solid rgba(227, 230, 232, 0.45);
}
